import React, {Component} from 'react';
import './App.css';
import Nav from "./Components /Nav";
import {BrowserRouter} from 'react-router-dom';

class App extends Component {
  render(){
    return (
      <BrowserRouter>
        <div className="App">
          <Nav />
        </div>
      </BrowserRouter>
    );
  }
}

export default App;
